import React from 'react'
import MediaCard from './Card';
import { Grid } from '@material-ui/core';
import Emily from '../../images/sample_image.jpg';

const techteam=[
    {
        name: "Lu Wang",
        linkedin: "",
        designation: "Lead UX Designer",
        image: Emily,
    },
    {
        name: "Neelanshi Sharma",
        linkedin: "",
        designation: "Lead FrontEnd Developer",
        image: Emily,
    },
    {
        name: "Gracie",
        linkedin: "",
        designation: "",
        image: Emily,
    },
    {
        name: "Ashley",
        linkedin: "",
        designation: "",
        image: Emily,
    },
]

function Tech_Team() {
    return (
        <Grid container spacing={4} justify="center">
            {techteam.map((e) => {
                return(
                    <Grid item xs={6} sm={4}>
                        <MediaCard 
                            name={e.name}
                            linkedin={e.linkedin}
                            image={e.image}
                            designation={e.designation}/>
                    </Grid>
                );
            })}
        </Grid>
    )
}

export default techteam
